import "./ExpenseItem.css";

function ExpenseItem() {
    const expenseDate = new Date(2021, )
    return <div className="expense-item">
        <div>March 22th 2023</div>
        <div className="expense-item__description"><h2>Psychiatrist</h2></div>
        <div className="expense-item__price">$450.00</div>
    </div>
}

export default ExpenseItem;
